    false,nt"url": null,nt"notes": "Wilderness character monitoring occurred
    at Okefenokee National Wildlife Refuge between the dates of 27 June 2011 and 20
    August 2011.  Wilderness character monitoring was developed in order to provide
    a standardized approach to monitoring trends and changes in the wilderness.  As
    each federally designated wilderness is fundamentally disparate, what is monitored
    and how it is monitored will be unique for each wilderness.  At Okefenokee National
    Wildlife Refuge, we have compiled a list of twenty-three measures that will be used
    in subsequent years to observe how the wilderness character has changed over time.",nt"owner_org":
